import React from 'react';
import web from "D:\Dharmveerreact\practiceproj\image\img2.jpg";
// import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
// import '../node_modules/bootstrap/dist/js/bootstrap.min.js';

// <div className='container-fluid nav_bg'>
//     <div className='row'>
//         <div className='col-10 mx-auto'>

//         </div>
//     </div>
// </div>



const Home = () => {
    return (
        <>
            <section id='header' className='d-flex align-items-center'>
                <div className='container-fluid nav_bg'>
                    <div className='row'>
                        <div className='col-10 mx-auto'>
                            <div className='row'>
                                <div className='col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column'>
                                    <h1>
                                        <strong>Gate</strong> 2022 Result Declared
                                    </h1>
                                    <p className='my-3'>More than 30+ students qualified for GATE 2022</p>
                                    <div className='mt-3'>

                                        <a href='' className='btn btn-get-started '>
                                            Click Here!
                                        </a>
                                    </div>
                                </div>
                                <div className='col-lg-6 order-1 order-lg-2 header-img'>
                                    <img
                                    src={web}
                                    className='img-fluid aimated'
                                    alt='img'
                                     />
                                </div>

                            </div>
                        </div>
                    </div>
                </div>

            </section>

        </>
    )
}

export default Home;
